import React from 'react'

function App () {
  function tick () {
    const date = new Date()
    return date.toLocaleString()
  }
  const element = <h1>Hello World {tick()}</h1>
  setInterval(() => {
    tick
  }, 1000);
  return (
    element
  )
}

export default App
